const HomePage = () => {
	return html` <div class="${cx("main")}">
		<h1 class="${cx("title")}">Home</h1>
		<div class="${cx("content")}">
			<div class="row">
				${SKILL.map((item) => {
					return `
						<div class="col-2 py-5">
							${Skill(item)}
						</div>
					`
				})}
			</div>
		</div>
	</div>`
}

export default HomePage
